INSERT INTO `numerals` VALUES (1,'Numeral 1','Estructura orgánica y funciones de cada una de las dependencias y departamentos, incluyendo su marco normativo;',10),(2,'Numeral 2','Dirección y teléfonos de la entidad y de todas las dependencias que la conforman;',10),(3,'Numeral 3','Directorio de empleados y servidores públicos, incluyendo números de teléfono y direcciones de correo electrónico oficiales no privados; quedan exentos de esta obligación los sujetos obligados cuando se ponga en riesgo el sistema nacional de seguridad, la investigación criminal e inteligencia del Estado;',10),(4,'Numeral 4','Número y nombre de funcionarios, servidores públicos, empleados y asesores que laboran en el sujeto obligado y todas sus dependencias, incluyendo salarios que corresponden a cada cargo, honorarios, dietas, bonos, viáticos o cualquier otra remuneración económica que perciban por cualquier concepto. Quedan exentos de esta obligación los sujetos obligados cuando se ponga en riesgo el sistema nacional de seguridad, la investigación criminal e inteligencia del Estado;',10),(5,'Numeral 5','La misión y objetivos de la institución, su plan operativo anual y los resultados obtenidos en el cumplimiento de los mismos;',10),(6,'Numeral 6','Manuales de procedimientos, tanto administrativos como operativos;',10),(7,'Numeral 7','La información sobre el presupuesto de ingresos y egresos asignado para cada ejercicio fiscal; los programas cuya elaboración y/o ejecución se encuentren a su cargo y todas las modificaciones que se realicen al mismo, incluyendo transferencias internas y externas;',10),(8,'Numeral 8','Los informes mensuales de ejecución presupuestaria de todos los renglones y de todas las unidades, tanto operativas como administrativas de la entidad;',10),(9,'Numeral 9','La información detallada sobre los depósitos constituidos con fondos públicos provenientes de ingresos ordinarios, extraordinarios, impuestos, fondos privativos, empréstitos y donaciones;',10),(10,'Numeral 10','La información relacionada con los procesos de cotización y licitación para la adquisición de bienes que son utilizados para los programas de educación, salud, seguridad, desarrollo rural y todos aquellos que tienen dentro de sus características la entrega de dichos bienes a beneficiarios directos o indirectos, indicando las cantidades, precios unitarios, los montos, los renglones presupuestarios correspondientes, las características de los proveedores, los detalles de los procesos de adjudicación y el contenido de los contratos;',10),(11,'Numeral 11','La información sobre contrataciones de todos los bienes y servicios que son utilizados por los sujetos obligados, identificando los montos, precios unitarios, costos, los renglones presupuestarios correspondientes, las características de los proveedores, los detalles de los procesos de adjudicación y el contenido de los contratos;',10),(12,'Numeral 12','Listado de viajes nacionales e internacionales autorizados por los sujetos obligados y que son financiados con fondos públicos, ya sea para funcionarios públicos o para cualquier otra persona, incluyendo objetivos de los viajes, personal autorizado a viajar, destino y costos, tanto de boletos aéreos como de viáticos;',10),(13,'Numeral 13','La información relacionada al inventario de bienes muebles e inmuebles con que cuenta cada uno de los sujetos obligados por la presente ley para el cumplimiento de sus atribuciones;',10),(14,'Numeral 14','Información sobre los contratos de mantenimiento de equipo, vehículos, inmuebles, plantas e instalaciones de todos los sujetos obligados, incluyendo monto y plazo del contrato e información del proveedor;',10),(15,'Numeral 15','Los montos asignados, los criterios de acceso y los padrones de beneficiarios de los programas de subsidios, becas o transferencias otorgados con fondos públicos;',10),(16,'Numeral 16','La información relacionada a los contratos, licencias o concesiones para el usufructo o explotación de bienes del Estado;',10),(17,'Numeral 17','Los listados de las empresas precalificadas para la ejecución de obras públicas, de venta de bienes y de prestación de servicios de cualquier naturaleza, incluyendo la información relacionada a la razón social, capital autorizado y la información que corresponda al renglón para el que fueron precalificadas;',10),(18,'Numeral 18','El listado de las obras en ejecución o ejecutadas total o parcialmente con fondos públicos, o con recursos provenientes de préstamos otorgados a cualquiera de las entidades del Estado, indicando la ubicación exacta, el costo total de la obra, la fuente de financiamiento, el tiempo de ejecución, beneficiarios, empresa o entidad ejecutora, nombre del funcionario responsable de la obra, contenido y especificaciones del contrato correspondiente;',10),(19,'Numeral 19','Los contratos de arrendamiento de inmuebles, equipo, maquinaria o cualquier otro bien o servicio, especificando las características de los mismos, motivos del arrendamiento, datos generales del arrendatario, monto y plazo de los contratos;',10),(20,'Numeral 20','Información sobre todas las contrataciones que se realicen a través de los procesos de cotización y licitación y sus contratos respectivos, identificando el número de operación correspondiente a los sistemas electrónicos de registro de contrataciones de bienes o servicios, fecha de adjudicación, nombre del proveedor, monto adjudicado, plazo del contrato y fecha de aprobación del contrato respectivo;',10),(21,'Numeral 21','Destino total del ejercicio de los recursos de los fideicomisos constituidos con fondos públicos, incluyendo la información relacionada a las cotizaciones o licitaciones realizadas para la ejecución de dichos recursos y gastos administrativos y operativos del fideicomiso;',10),(22,'Numeral 22','El listado de las compras directas realizadas por las dependencias de los sujetos obligados;',10),(23,'Numeral 23','Los informes finales de las auditorías gubernamentales o privadas practicadas a los sujetos obligados, conforme a los períodos de revisión correspondientes;',10),(24,'Numeral 24','En caso de las entidades públicas o privadas de carácter internacional, que manejen o administren fondos públicos deberán hacer pública la información obligatoria contenida en los numerales anteriores, relacionada únicamente a las compras y contrataciones que realicen con dichos fondos;',10),(25,'Numeral 25','En caso de las entidades no gubernamentales o de carácter privado que manejen o administren fondos públicos deben hacer pública la información obligatoria contenida en los numerales anteriores, relacionada únicamente a las compras y contrataciones que realicen con dichos fondos;',10),(26,'Numeral 26','Los responsables de los archivos de cada uno de los sujetos obligados deberán publicar, por lo menos una vez al año, y a través del Diario de Centro América, un informe sobre: el funcionamiento y finalidad del archivo, sus sistemas de registro y categorías de información, los procedimientos y facilidades de acceso al archivo;',10),(27,'Numeral 27','El índice de la información debidamente clasificada de acuerdo a esta ley;',10),(28,'Numeral 28','Las entidades e instituciones del Estado deberán mantener informe actualizado sobre los datos relacionados con la pertenencia sociolingüística de los usuarios de sus servicios, a efecto de adecuar la prestación de los mismos;',10),(29,'Numeral 29','Cualquier otra información que sea de utilidad o relevancia para cumplir con los fines y objetivos de la presente ley.',10),(30,'Numeral 1','El ejercicio de su presupuesto asignado por ministerio, viceministerio, direcciones generales e instituciones descentralizadas;',11),(31,'Numeral 2','El listado de asesores, con sus respectivas remuneraciones de cada una de las instituciones mencionadas en el numeral anterior;',11),(32,'Numeral 3','El informe de los gastos y viáticos de las delegaciones de cada institución al exterior del país, así como el destino, objetivos y logros alcanzados.',11),(33,'Numeral 1','Las sentencias condenatorias dictadas con autoridad de cosa juzgada por delitos de derechos humanos y lesa humanidad;',12),(34,'Numeral 2','Las sentencias condenatorias con autoridad de cosa juzgada, por delitos en caso de manejo de fondos públicos;',12),(35,'Numeral 3','Las sentencias condenatorias con autoridad de cosa juzgada por delitos cometidos por funcionarios y empleados públicos;',12),(36,'Numeral 4','El ejercicio de su presupuesto asignado a la Corte Suprema de Justicia, Salas de Apelaciones, Tribunales de Primera Instancia de Ejecución y Sentencia, y Juzgados de Paz de todo el país;',12),(37,'Numeral 5','El listado de asesores con sus respectivas remuneraciones de cada uno de los tribunales mencionados en el numeral anterior;',12),(38,'Numeral 6','El informe de los gastos y viáticos de las delegaciones de cada institución al exterior del país, así como el destino, objetivos y logros alcanzados.',12),(39,'Numeral 1','El ejercicio de su presupuesto asignado por bloque legislativo y comisión;',13),(40,'Numeral 2','El listado de asesores y asistentes de Junta Directiva, bloques legislativos, bancadas, comisiones y diputados con sus respectivas remuneraciones;',13),(41,'Numeral 3','El proyecto del orden del día de las sesiones ordinarias y extraordinarias en el pleno y comisiones, con veinticuatro horas de anticipación;',13),(42,'Numeral 4','Las iniciativas de ley;',13),(43,'Numeral 5','Los dictámenes emitidos por cada una de las comisiones sobre las iniciativas de ley;',13),(44,'Numeral 6','Los decretos;',13),(45,'Numeral 7','Los acuerdos;',13),(46,'Numeral 8','Los puntos resolutivos;',13),(47,'Numeral 9','Las resoluciones;',13),(48,'Numeral 10','Actas de las sesiones de las comisiones de trabajo;',13),(49,'Numeral 11','Diario de las Sesiones Plenarias.',13),(50,'Numeral 1','Datos generales de la organización;',14),(51,'Numeral 2','Acuerdo o resolución de la autoridad que las autoriza;',14),(52,'Numeral 3','Integrantes de la junta directiva;',14),(53,'Numeral 4','Estatutos;',14),(54,'Numeral 5','Objetivos;',14),(55,'Numeral 6','Misión y visión;',14),(56,'Buenas prácticas de Gobierno Abierto','Buenas prácticas de Gobierno Abierto (formatos editables, desglose por género, publicaciones en idiomas mayas, información historica, información fácil de encontrar)',100);
